INSERT INTO `creature_text` (`Entry`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextID`) VALUES 
(110599, 0, 0, 'С чего же начать? Думаю, по-настоящему важной была только моя битва с демоном.', 12, 0, 100, 0, 0, 0, 118532),
(110599, 1, 0, 'Разелих Осквернитель был повелителем ужаса, которому поручили покорение Выжженных земель. Я отправился туда, чтобы остановить его, но все пошло не так, как я ожидал.', 12, 0, 100, 0, 0, 0, 118533),
(110599, 2, 0, 'В итоге Осквернитель вселился в меня... а я пожертвовал собой, чтобы погубить нас обоих. Целую вечность наши души сражались в чародейском клинке.', 12, 0, 100, 0, 0, 0, 118534),
(110599, 3, 0, 'Через некоторое время клинок был уничтожен. Наши души спаслись, но их тут же отправили в Круговерть Пустоты. Однако душа демона Разелиха необычайно сильна. И, как нередко происходит у повелителей ужаса, скоро она сформировала новое тело. Говорят, что убить повелителя ужаса можно лишь в Круговерти Пустоты.', 12, 0, 100, 0, 0, 0, 118535),
(110599, 4, 0, 'В этом новом теле наши души продолжают бороться друг с другом. Большую часть времени я держу повелителя ужаса в узде... Это нелегко, но охотники на демонов привыкли бороться с демоном внутри.', 12, 0, 100, 0, 0, 0, 118536),
(110599, 5, 0, 'Не успел я опомниться, как нас уже вышвырнули из Круговерти Пустоты и призвали в Пылающий Легион на войну с Азеротом. В битве за врата Пламени Скверны я приложил все усилия, чтобы помешать их замыслу.', 12, 0, 100, 0, 0, 0, 118537),
(110599, 6, 0, 'Дальше ты все знаешь. Твои защитники спасли меня, и вот я стою перед тобой.', 12, 0, 100, 0, 0, 0, 118538),
(110599, 7, 0, 'Я буду рад тебе служить, если ты примешь мою службу. Я знаю все, что было известно Разелиху, и хочу помочь в борьбе против Легиона.', 12, 0, 100, 0, 0, 0, 118539);

